import React from 'react';
import './Navigation.css';
import Timer from './Timer'

function Navigation() {
    return (
        <fieldset>
        <Timer />
        <hr/>
        <a href="localhost:3000">HOME</a> <br/>
          <a href="/">PROFILE</a> <br/>
          <a href="https://github.com/GaeTaeng?tab=repositories">github</a> <br/>
          <a href="https://www.linkedin.com/in/tae-hun-kim-434552168/">LinkedIn</a> <br/>
        </fieldset>
    )
  }
  

  export default Navigation
